import { AppBar, Button, Container, Link, Toolbar, Typography } from "@material-ui/core";
import {NavLink, Route, Switch} from 'react-router-dom';

import Books from "./Books";
import Characters from "./Characters";
import Movies from "./Movies";

function App() {
  return (
    <div className="App">
      <Container maxWidth="lg">

        <AppBar position="relative">
          <Toolbar className="toolbar">
            <Typography variant="h6">The ONE to rule them all</Typography>
            <div>
              <NavLink exact to="/" activeClassName="active">Books</NavLink>
              <NavLink to="/movies" activeClassName="active">Movies</NavLink>
              <NavLink to="/characters" activeClassName="active">Characters</NavLink>

              {/* <Button color="inherit">Books</Button>
              <Button color="inherit">Movies</Button>
              <Button color="inherit">Characters</Button> */}
            </div>
          </Toolbar>
        </AppBar>



        <Switch>
          <Route path="/characters/" component={Characters} />
          <Route path="/movies/" component={Movies} />
          <Route exact path="/" component={Books} />
        </Switch>


        {/* <p>Playing with the lord of the rings API</p>
